import React from "react"
import Check from "./Check"

const TodoItem = ({todo, changeTodo}) => {
    return (
        <button className="flex items-center mb-4 rounded-xl bg-gray-800 p-5 w-full" onClick={() => changeTodo(todo._id)}>
            <Check />
            {todo.title}
        </button>
    )
}

export default TodoItem
